import axios from "axios";

export const purchasePutRequest = async (productDetailId, config) => {
  await axios
    .put(`http://bootcampapi.techcs.io/api/fe/v1/product/offer/${productDetailId}`, config)
    .then((response) => console.log(response))
    .catch((err) => console.log(err));
};
